import React from 'react';

function FilmesTable(props) {
    const filmes = props.filmes;

    if (!filmes || filmes.length === 0) {
        return <p>Nenhum filme encontrado.</p>;
    }

    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Nome</th>
                    <th>Gênero</th>
                    <th>Ação</th>
                </tr>
            </thead>
            <tbody>
                {filmes.map(filme => (
                    <tr key={filme.id}>
                        <td>{filme.nome}</td>
                        <td>{filme.genero}</td>
                        <td>
                            <button className="btn btn-primary">Alugar</button>
                        </td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
}

export default FilmesTable;
